import React from 'react';
import {View, Text} from 'react-native';
import Cadastro from './src/pages/Cadastro'
import { NavigationContainer } from '@react-navigation/native';
import Login from './src/pages/Login';

const App = () => {

return (

  <NavigationContainer>
    <Cadastro/>
    <Login/>
  </NavigationContainer>

);

}

export default App;
